import styled from 'styled-components'
import StyledSummary from '../../CartPage/Summary/StyledSummary';

const StyledOrderSummary = styled(StyledSummary)`

    .ordertotal {
        font-size: 18px;
        font-weight: 600;
}
    .line {
        border-top: 1px solid#cccccc;
}
`;

export default StyledOrderSummary
